import React, { Component } from 'react';

import Coin from './Coin';

class CoinFlipper extends Component {
  render() {
    return (
      <div>
        <Coin name='coin'/>
        <button>FLIP MEEE!</button>
        <p>Out of X flips, there have been X heads and X tails</p>
      </div>
    )
  }
}

export default CoinFlipper;
